                    "x": 48.0,
                    "y": 12.0,
                    "tooltip": "\u90a3\u4e9b\u89d2\u843d\u91cc\u7684\u4e00\u5768\u662f\u4ec0\u4e48?\u597d\u5427,\u90a3\u662fIn-Game-Info,\u4e00\u4e2a\u975e\u5e38\u65b9\u4fbf\u7684mod,\u53ef\u4e3a\u4f60\u63d0\u4f9b\u8bb8\u591aGT<br/>NH\u7684\u5fc5\u8981\u4fe1\u606f.\u6700\u91cd\u8981\u7684\u4fe1\u606f\u662f\u5224\u65ad\u4f60\u662f\u5426\u5728\u77ff\u8109\u4e2d\u5fc3.\u7a0d\u540e\u7684\u4efb\u52a1\u5c06\u8be6\u7ec6\u8bb2\u89e3\u5b83\u7684\u542b\u4e49.\u5982\u679c\u4f60\u4e0d\u60f3\u770b\u5230IG<br/>I\u7684\u4fe1\u606f,\u4f7f\u7528/igi disable/igi enable\u6765\u7981\u7528\u6216\u542f\u7528\u754c\u9762./igi config<br/>\u5c06\u6253\u5f00\u914d\u7f6e\u754c\u9762,\u5728\u8fd9\u91cc\u4f60\u53ef\u4ee5\u8bbe\u7f6e\u5b83\u7684\u4f4d\u7f6e,\u5b57\u4f53\u5927\u5c0f\u7b49.\u53e6\u4e00\u4e2a\u6709\u7528\u7684\u662fExtra-Utilities\u7684<br/>TPS\u8868.\u5b83\u4f1a\u7ed9\u51fa\u77ac\u65f6TPS\u3001\u5e73\u5747TPS\u4ee5\u53ca\u6700\u4f4eTPS.TPS\u662fTicks-Per-Second(\u6bcf<br/>\u79d2tick\u6570)\u7684\u7b80\u79f0,\u662f\u8861\u91cf\u670d\u52a1\u5668\u8fd0\u884c\u72b6\u51b5\u7684\u4e00\u4e2a\u6307\u6807. \u7406\u60f3\u60c5\u51b5\u4e0bTPS=20,TPS\u4f4e\u4e8e15\u5c06\u5f00\u59cb<br/>\u611f\u89c9\u5230\u5ef6\u8fdf.TPS\u4f4e\u4e8e10\u73a9\u8d77\u6765\u5c31\u4e0d\u592a\u723d\u4e86.\u5982\u679c\u4f60\u9700\u8981\u89e3\u51b3TPS\u95ee\u9898\u7684\u5efa\u8bae,\u8bf7\u901a\u8fc7Discord\u4e0e\u6211<br/>\u4eec\u8054\u7cfb.\u4f7f\u7528/xu_tps\u6307\u4ee4\u6765\u542f\u7528\u6216\u7981\u7528TPS\u8868.\u8bd1\u8005\u6ce8:TPS\u8868\u4e0a\u6bcf\u4e2a\u6570\u503c\u90fd\u662f\u4ee5X(Y)\u7684\u5f62\u5f0f\u5448<br/>\u73b0\u7684,X\u4ee3\u8868MSPT(\u6bcftick\u6beb\u79d2\u6570),Y\u4ee3\u8868TPS."
